import React from 'react';
import {useRouter} from 'next/router';

export default Campaign = () => {
    const router = useRouter();
    const {id} = router.query;
    return(
        <div>
            <h1>EXISTS CAMPAIGN {id}</h1>
        </div>
    )
}
